import { Form } from 'react-router-dom';
import './App.css';
function Signup(){
    return(
<>
<div className='row'>
 
    <form onSubmit={handleSubmit}>
        <input
          className="form-control mb-3"
          placeholder="Email"
          value={form.email}
          onChange={(e) =>
            setForm({ ...form, email: e.target.value })
          }
        />
 </form>
</div>
</>
    );
}
export default Signup;
